import React, {Fragment} from 'react'

const About = () => {
  return (
    <Fragment>
      <div>
        <h1>About this App</h1>
        <p>App to search GitHub users</p>
        <p>Version 1.0.0</p>
      </div>
    </Fragment>

  )
}

export default About
